                            <div id="suggestions" className="section level2">
                                <h2>6. Suggestions</h2>
                                <p>Now is a time to look back at the Business tasks to provide a suggestion that would match Bellabeat’s vision.</p>
                                <div id="introduce-a-reward-system" className="section level3">
                                    <h3>Introduce a Reward System</h3>
                                    <p>According to our studies, we found that nearly a third of the population are having activity levels which are lower than suggested of around 10,000 steps. In this case, we can introduce the reward system for giving prizes or badges for completing such task. This reward system would apply to all catagories including active levels, sleep levels, and how often the user wears the device.</p>
                                </div>
                                <div id="sleep-reminder" className="section level3">
                                    <h3>Sleep Reminder</h3>
                                    <p>From the above discoveries, we find that sleep is a category where the data shows the most lack of, as in lack of sleep time. Over half of the population are receiving less than 7 hours of sleep, which is below the recommended amount of around 8 hours. In this case, we can send out a reminder at a time where it will let the user know how to get the healthy and correct amount of sleep for the night.</p>
                                </div>
                                <div id="active-alert" className="section level3">
                                    <h3>Active Alert</h3>
                                    <p>We can also introduce an active alert, telling the user to get the healthy amount of activity in within the day, and simply stand for a bit after sitting down for too long, which are both beneficial for the human body in the long run.</p>
                                </div>
                            </div>
